Das "scope" oder bzw. die Reichweite legt fest, in welchem Teil eines Programms Variablen oder Konstanten sichtbar sind. Scopes sind leicht mit Zahlenmengen zu vergleichen/zu veranschaulichen: Definieren wir eine mathematische Funktion f, die natürliche Zahlen \( \mathbb{N} \) als Eingabewerte erwartet: \[ f(x) = y = x + 1; x, y \in \mathbb{N} \] Da wir festgelegt haben, dass x und y beliebige natürliche Zahlen sein müssen, können wir für x nicht \( \pi \) einsetzen (weil es eine reele Zahl ist), und im Term der Funktion auch nicht nutzen, denn das Ergebnis y der Funktion ist ebenfalls als natürliche Zahl definiert. \( \pi )) liegt ausserhalb der Reichweite der Reichweite der natürlichen Zahlen. Hätten wir x und y als reele Zahlen definiert, so könnten wir sehr wohl auch 2 oder 1 für x einsetzen, denn die natürlichen Zahlen sind eine Teilmenge der reelen Zahlen, liegen also in deren "Reichweite": TODO: Grafik mit Zahlenbereiche als Zwiebeldiagramm einfügen Um das Zwiebeldiagramm in Pseudocode zu übertragen (ein neues, geschachteltes Scope wird in Java mit { und } ein- und ausgeleitet, oder stattdessen mit Einrücken in Python): { // 1: natürliche Zahlen { // 2: reelle Zahlen { // 3: komplexe Zahlen } }
} Huch, das ist ja andersrum? Genau! Das "allwissende" Scope/Reichweite ist das am tiefsten Eingerückte bzw. das am meisten Geschachtelte. Anders als bei der Zahlenmengenanalogie beinhaltet es nicht die anderen Scopes, sondern wird von den anderen beinhaltet. Ein Wert der in Scope 1 definiert wurde, ist also auch in Scope 2 und 3 sichtbar, andersherum ist ein Wert der in Scope 3 definiert wurde nicht in den Scopes 2 und 3 sichtbar. Also gilt Folgendes: { int i = 0; { int j = 0; i = 1; // ok! { j = 5; // ok! i = 3; // auch ok! int x = 0; } x = 5; // ERROR! auf das geschachtelte Scope kann nicht zugegriffen werden! j = 1; // ok, im gleichen Scope }
